import React from 'react';
import {highScores} from './highScoreData';
function HighScore() {
  return (
    <div>
      {highScores.map((dat) => (
        <>
        <p>{dat.username}</p>
        <p>{dat.date}</p>
        <p>{dat.score}</p>
        </>
      ))}
    </div>
  );
}

export default HighScore;
